export default function App() {
  return (
    <div style={{ padding: 20 }}>
      <h1>FastAPI Admin</h1>
      <Columns style={{width: '100%'}}>
        <Device />
        <hr />
        <Group />
      <hr />
      </Columns>
      <Columns>
        <hr />
        <Shop />
        <hr />
        <Video />
      </Columns>
    </div>
  );
}
